import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const initialShot = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: initialShot });
    screenshots.push(initialShot);

    // Open the cart modal by clicking the cart element (using text selector)
    await page.waitForSelector('text=Cart', { timeout: 5000 });
    await page.click('text=Cart');

    // Wait for the cart modal to appear by looking for "Your cart" or cart item
    await page.waitForSelector('.cart-item', { timeout: 5000 });

    // Take screenshot of cart modal open
    const cartOpenShot = path.join(screenshotsDir, 'step_2_cart_open.png');
    await page.screenshot({ path: cartOpenShot });
    screenshots.push(cartOpenShot);

    // Find the first cart item and its "+" button using xpath (to ensure different selector strategy)
    const plusBtn = await page.waitForSelector('//div[contains(@class,"cart-item")]//button[contains(text(),"+")]', { timeout: 5000 });
    // Get the current quantity before increment
    const quantitySpan = await page.waitForSelector('//div[contains(@class,"cart-item")]//span[contains(@class,"quantity")]', { timeout: 5000 });
    const quantityBefore = await quantitySpan.textContent();

    // Click the "+" button to increase quantity
    await plusBtn.click();

    // Wait for the quantity to update (wait for text to change)
    await page.waitForFunction(
      (oldQty) => {
        const el = document.evaluate('//div[contains(@class,"cart-item")]//span[contains(@class,"quantity")]', document, null, XPathResult.FIRST_ORDERED_NODE_TYPE, null).singleNodeValue;
        return el && el.textContent.trim() !== oldQty.trim();
      },
      quantityBefore,
      { timeout: 5000 }
    );

    // Get the new quantity after increment
    const quantityAfter = await page.$eval(
      '//div[contains(@class,"cart-item")]//span[contains(@class,"quantity")]',
      el => el.textContent
    );

    // Take screenshot after quantity update
    const afterUpdateShot = path.join(screenshotsDir, 'step_3_quantity_updated.png');
    await page.screenshot({ path: afterUpdateShot });
    screenshots.push(afterUpdateShot);

    return {
      success: true,
      action: "Updated the quantity of the first cart item using the plus button in the cart modal.",
      extractedData: {
        quantityBefore: quantityBefore.trim(),
        quantityAfter: quantityAfter.trim()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
